import './App.css';


const App = () =>{
   const[counter,setCounter]=useState();
   useEffect(() => {
   alert("you have changed the counter to ")
   }, [counter])
  return (
    <div className="App">
      <button onClick={() => setCounter((prevCount) => prevCount-1)}>-</button>
      <button>{counter}</button>
      <button onClick={() => setCounter((prevCount) => prevCount+1)}>+</button>

    </div>
  );
}

export default App;
